 const socket=socketIOClient("http://localhost:4000",{path:"/javascript"})
 const o=openSocket()
class App extends React.Component {

  constructor(props){
    super(props)

  }
  componentDidMount(){


  }
  render(){
    return (
      <div className="App">
        <header className="App-header">
          <img src={logo} className="App-logo" alt="logo" />
          <p>
            Edit <code>src/App.js</code> and save to reload.
          </p>
          <a
            className="App-link"
            href="https://reactjs.org"
            target="_blank"
            rel="noopener noreferrer"
          >
            Learn React
          </a>
        </header>
      </div>
    );
  }

}

export default App;
